import React from 'react';
import '../css/Post.css';
import Avatar from '@material-ui/core/Avatar';

function Post() {
    return (
        <div className="post">
            <div className="post_header">
            <Avatar  className="post_avatar" alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
            <p><strong>Username : </strong> Hi i am Rajat</p> 

            </div>
        
         <img className="post_image" src="https://www.clipartkey.com/mpngs/m/118-1188761_avatar-cartoon-profile-picture-png.png" alt="b" />  
        </div>
    )
}

export default Post;
